import Card from "./Card";
import LineCardContent from "./LineCardContent";

const cardData = [
    {
        id: 1,
        image: image2,
        primaryText: "Mira Softworks Website:",
        secundaryText: "a small website where I can to share you a lot of incredible talent.",
        tag: "#Web issues"
    },

    {
        id: 2,
        image: image1,
        primaryText: "Power Up has been replaced",
        secundaryText: "One of the power ups has been replaced as meaningless in the current core...",
        tag: "#Game dev"
    },

    {
        id: 3,
        image: image2,
        primaryText: "Mira Softworks Website:",
        secundaryText: "Lorem ipsum"
    },
]

function LineCardView() {
    const content = [
        {
            id: 1,
            title: "Latest Issues"
        }
    ]

    return <>
        {
            content.map(contentSet => (
                <div className="col-md-2" key={contentSet.id}>
                    <LineCardContent title={contentSet.title}>
                        {
                            cardData.map(cardDataSet => (
                                <div className="col-md-4" key={cardDataSet.id}>
                                    <Card image={cardDataSet.image} primaryText={cardDataSet.primaryText} secundaryText={cardDataSet.secundaryText} tag={cardDataSet.tag} />
                                </div>
                            ))
                        }
                    </LineCardContent>
                </div>
            ))
        }
    </>
}

export default LineCardView;
